import React from 'react';
import { Link } from 'react-router-dom';

const Blog = ({blogInfo: {name, category, feature_image, }}) => {
  return (
    <div className='blog'>
      <div className='blog-thumb'>
        <a href="#!">
          <span>
            {category}
          </span>
          <Link to='/'>
            <img src={feature_image} alt={name}/>
          </Link>
        </a>
      </div>
    </div>
  );
}

export default Blog;
